import React, { useState } from 'react';
import apiService from '../../services/apiService';
import './APITester.css';

const APITester = () => {
  const [results, setResults] = useState({});
  const [loading, setLoading] = useState({});

  const testEndpoint = async (name, apiCall) => {
    setLoading(prev => ({ ...prev, [name]: true }));
    
    try {
      const result = await apiCall();
      setResults(prev => ({ 
        ...prev, 
        [name]: { 
          success: true, 
          data: result,
          timestamp: new Date().toLocaleTimeString()
        }
      }));
    } catch (error) {
      setResults(prev => ({ 
        ...prev, 
        [name]: { 
          success: false, 
          error: error.message,
          timestamp: new Date().toLocaleTimeString()
        }
      }));
    }
    
    setLoading(prev => ({ ...prev, [name]: false }));
  };

  const tests = [
    {
      name: 'health',
      label: 'Health Check',
      description: 'Kiểm tra trạng thái server',
      endpoint: 'GET /api/health',
      apiCall: () => apiService.healthCheck()
    },
    {
      name: 'currentUser',
      label: 'Current User',
      description: 'Lấy thông tin user hiện tại (cần token)',
      endpoint: 'GET /api/auth/me',
      apiCall: () => apiService.getCurrentUser()
    },
    {
      name: 'allUsers',
      label: 'All Users',
      description: 'Lấy danh sách tất cả users (cần token)',
      endpoint: 'GET /api/users',
      apiCall: () => apiService.getAllUsers()
    }
  ];

  return (
    <div className="api-tester">
      <h2>API Tester</h2>
      <p className="tester-description">
        Công cụ test các API endpoints của backend
      </p>

      <div className="test-grid">
        {tests.map(test => (
          <div key={test.name} className="test-card">
            <div className="test-header">
              <h3>{test.label}</h3>
              <code className="endpoint">{test.endpoint}</code>
            </div>
            
            <p className="test-description">{test.description}</p>
            
            <button
              onClick={() => testEndpoint(test.name, test.apiCall)}
              disabled={loading[test.name]}
              className="test-button"
            >
              {loading[test.name] ? (
                <>
                  <i className="fas fa-spinner fa-spin"></i>
                  Testing...
                </>
              ) : (
                <>
                  <i className="fas fa-play"></i>
                  Test API
                </>
              )}
            </button>

            {results[test.name] && (
              <div className={`test-result ${results[test.name].success ? 'success' : 'error'}`}>
                <div className="result-header">
                  <span className={`status ${results[test.name].success ? 'success' : 'error'}`}>
                    {results[test.name].success ? '✅ Success' : '❌ Error'}
                  </span>
                  <span className="timestamp">{results[test.name].timestamp}</span>
                </div>
                
                <pre className="result-data">
                  {JSON.stringify(
                    results[test.name].success ? results[test.name].data : { error: results[test.name].error }, 
                    null, 
                    2
                  )}
                </pre>
              </div>
            )}
          </div>
        ))}
      </div>

      <div className="api-info-section">
        <h3>Backend Information</h3>
        <div className="info-grid">
          <div className="info-item">
            <strong>Backend URL:</strong>
            <span>http://localhost:5000</span>
          </div>
          <div className="info-item">
            <strong>API Base:</strong>
            <span>http://localhost:5000/api</span>
          </div>
          <div className="info-item">
            <strong>Authentication:</strong>
            <span>JWT Token (Bearer)</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default APITester;
